import React from 'react';
import { useParams } from 'react-router';
import './ProductDetail.css'

const ProductDetail = () => {
    const {productKey} = useParams();

    return (
        <div>
            <h1>{productKey} detail comming soooooooooon</h1>
        </div>
    );
};

export default ProductDetail;
